def comp(ctrlstr,fstr,lstr):
    l=''
    outstr=''
    ind1=0
    dcount=0
    icount=0
    for c in ctrlstr:
        if (c.isdigit()): 
            l+=c
        else:
            ind2=ind1+int(l)
            if (c=='M'):
                outstr+=fstr[(ind1):(ind2)]
                l=''
            elif (c=='D'):
                outstr+='('+fstr[(ind1):(ind2)]+')'
                dcount+=int(l)
                l=''
            elif (c=='I'):
                outstr+='['+lstr[(ind1-dcount+icount):(ind2-dcount+icount)]+']'
                icount+=int(l)
                l=''
            ind1=ind2
    return outstr

